island.

가사 넘 좋다.. 라이브 보고 와서 더 좋아지는 곡들이 있는데 island가 그랬다.
특히 이 곡을 잘 모른 채 아이다호 공연에 갔었는데 마지막에 저 디스토션? 부분이 되게 인상적였다. 저러다 쓰러지는거 아닌가? 공연에 저만큼 몸을 다 바치나? 라고 생각했는데 이번 공연에 가까이서 보니 island 엔딩에서 그리 부서지는 빙하처럼 연주하더니 이어서 바로 호흡 가다듬고 팽팽하게 당겨지듯 surrender 시작하는데... 그 집중력에 더 소름 돋았다는.
.
.
.
아끼려고 아끼는 건 아니고, 현세에 무리가 올까봐 하루에 (못하는 날도 있지만) 한 곡씩 찬찬히 다시 보는데 정말 매순간이 예술이다. 기타 잘치는 인물들이야 많다지만,,,사람이 뭘하든지 오리지널리티가 있어야 하는 법이고 이토록 자신의 세계, 개성이 강해서 존재감을 내뿜는 기타리스트들이 난 좋더라 ㅠㅠ
몇년전부터 알긴 알았는데, 이제야 치인게 좀 희한하지만 늘 그렇듯 '때'가 있는 거니까.. 주변을 아무리 오래 맴돌아도 "그때는 틀리고 지금은 맞는," 그렇게 딱 주파수가 맞는 때가 늘 있더라. 뮤지션도 변하고 나도 변하니까. 모쪼록 같은 호흡으로 긴 흐름을 함께 탈 수 있기를.

